  XW += x[2] * 1.4026999999999999e+01;       // CH2
  XW += x[3] * 1.4026999999999999e+01;       // CH2(S)
  XW += x[4] * 1.5035000000000000e+01;       // CH3
  XW += x[5] * 1.5999000000000001e+01;       // O
  XW += x[6] * 1.6042999999999999e+01;       // CH4
  XW += x[7] * 1.7007000000000001e+01;       // OH
  XW += x[8] * 1.8015000000000001e+01;       // H2O
  XW += x[9] * 2.6037999999999997e+01;       // C2H2
  XW += x[10] * 2.7045999999999999e+01;      // C2H3
  XW += x[11] * 2.8009999999999998e+01;      // CO
