  XW += x[20] * 3.3006000000000000e+01;      // HO2
  XW += x[21] * 3.4014000000000003e+01;      // H2O2
  XW += x[22] * 4.4009000000000000e+01;      // CO2
  XW += x[23] * 4.4052999999999997e+01;      // CH3HCO
  XW += x[24] * 4.5061000000000000e+01;      // CH3OCH2
  XW += x[25] * 4.6024999999999999e+01;      // HCOOH
