  W += c[22] * 4.4009000000000000e+01; // CO2
  W += c[23] * 4.4052999999999997e+01; // CH3HCO
  W += c[24] * 4.5061000000000000e+01; // CH3OCH2
  W += c[25] * 4.6024999999999999e+01; // HCOOH
