  W += c[27] * 4.7033000000000001e+01; // HOCH2O
  W += c[28] * 5.9043999999999997e+01; // CH3OCO
  W += c[29] * 6.0052000000000000e+01; // CH3OCHO
  W += c[30] * 6.1060000000000002e+01; // CH3OCH2O
  W += c[31] * 6.2067999999999998e+01; // CH3OCH2OH
  W += c[32] * 7.5043000000000006e+01; // OCH2OCHO
  W += c[33] * 7.5043000000000006e+01; // HOCH2OCO
  W += c[34] * 7.7058999999999997e+01; // CH3OCH2O2
