  qf[18] = sc[17];
  qr[18] = sc[0] * sc[15];

  // reaction 63: CH3O + M <=> CH2O + H + M
  qf[19] = sc[18];
  qr[19] = sc[0] * sc[15];

  // reaction 118: CH2(S) + M <=> CH2 + M
  qf[20] = sc[3];
  qr[20] = sc[2];

